import TodoList from '../TodoList';

function Home() {
  const [todos,setTodos] = useState([])
  return (
    <>
      <HeroSection />
      <Cards />
      <TodoList lanjiaos={todos}/>
      <input type = "text"/>
      <button onClick={handleAddTodo}>Add Todo</button>
      <button>Clear Complete</button>
      <div>0 left to do</div>
      <Footer />
    </>
  );
}

export default Home;
